package com.mizhousoft.cloudsdk.tencent.ocr;

import org.junit.jupiter.api.BeforeAll;
import org.junit.jupiter.api.Test;
import org.slf4j.Logger;
import org.slf4j.LoggerFactory;

import com.mizhousoft.cloudsdk.CloudSDKException;
import com.mizhousoft.cloudsdk.TempCredential;
import com.mizhousoft.cloudsdk.tencent.auth.Credential;
import com.mizhousoft.cloudsdk.tencent.auth.RegionEnum;
import com.mizhousoft.cloudsdk.tencent.ocr.impl.DefaultOcrClient;
import com.mizhousoft.commons.httpclient.unirest.UnirestLogInterceptor;

import kong.unirest.core.Unirest;

/**
 * DefaultOcrClient Test
 *
 * @version
 */
public class DefaultOcrClientTest
{
	private static final Logger LOG = LoggerFactory.getLogger(DefaultOcrClientTest.class);

	private static final String ACCESS_KEY = System.getenv("TENCENTCLOUD_SECRET_ID");

	private static final String SECRET_KEY = System.getenv("TENCENTCLOUD_SECRET_KEY");

	private static DefaultOcrClient ocrClient;

	@BeforeAll
	public static void before()
	{
		Unirest.config().interceptor(new UnirestLogInterceptor());

		Credential credential = new Credential();
		credential.setAccessKey(ACCESS_KEY);
		credential.setSecretKey(SECRET_KEY);

		ocrClient = new DefaultOcrClient(RegionEnum.GUANGZHOU, credential);
	}

	@Test
	public void genTempCredential() throws CloudSDKException
	{
		TempCredential response = ocrClient.genTempCredential(60);

		LOG.info(response.toString());
	}

	@Test
	public void imageBase64OCR() throws CloudSDKException
	{
		String imageBase64 = "data:image/png;base64,";
		String response = ocrClient.imageBase64OCR(imageBase64);

		LOG.info(response);
	}

	@Test
	public void imageUrlOCR() throws CloudSDKException
	{
		String imageUrl = "https://dev.mizhousoft.com/test.png";
		String response = ocrClient.imageUrlOCR(imageUrl);

		LOG.info(response);
	}
}
